import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './ForgotPassword.css';

export default function ForgotPassword() {
    const [form, setForm] = useState({
        username: '',
        newPassword: '',
        confirmPassword: ''
    });
    const [error, setError] = useState('');
    const navigate = useNavigate();

    function updateForm(value) {
        return setForm((prev) => {
            return { ...prev, ...value };
        });
    }

    async function onSubmit(e) {
        e.preventDefault();

        if (form.newPassword !== form.confirmPassword) {
            setError('Passwords do not match');
            return;
        }

        try {
            const response = await fetch('https://localhost:3001/user/forgot-password', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(form)
            });

            if (!response.ok) {
                let errorData;
                try {
                    errorData = await response.json();
                } catch (jsonError) {
                    throw new Error(`HTTP error! status: ${response.status}, message: ${response.statusText}`);
                }
                throw new Error(errorData.message || `HTTP error! status: ${response.status}`);
            }

            const data = await response.json();
            console.log('Password reset successful:', data);

            window.alert('Password has been reset successfully');
            navigate('/login');
        } catch (error) {
            console.error('Error during password reset:', error);
            setError(error.message);
        }
    }

    return (
        <div className="container mt-5">
            <div className="row justify-content-center">
                <div className="col-md-6">
                    <div className="card">
                        <div className="card-body">
                            <h3 className="card-title text-center mb-4">Forgot Password</h3>
                            <form onSubmit={onSubmit}>
                                <div className="form-group mb-3">
                                    <label htmlFor="usernameOrAccountNumber">Username or Account Number</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        id="usernameOrAccountNumber"
                                        value={form.usernameOrAccountNumber}
                                        onChange={(e) => updateForm({ usernameOrAccountNumber: e.target.value })}
                                        required
                                    />
                                    {error.usernameOrAccountNumber && <div className="error-message">{error.usernameOrAccountNumber}</div>}
                                </div>
                                <div className="form-group mb-3">
                                    <label htmlFor="newPassword">New Password</label>
                                    <input
                                        type="password"
                                        className="form-control"
                                        id="newPassword"
                                        value={form.newPassword}
                                        onChange={(e) => updateForm({ newPassword: e.target.value })}
                                        required
                                    />
                                    {error.newPassword && <div className="error-message">{error.newPassword}</div>}
                                </div>
                                <div className="form-group mb-3">
                                    <label htmlFor="confirmPassword">Confirm Password</label>
                                    <input
                                        type="password"
                                        className="form-control"
                                        id="confirmPassword"
                                        value={form.confirmPassword}
                                        onChange={(e) => updateForm({ confirmPassword: e.target.value })}
                                        required
                                    />
                                    {error.confirmPassword && <div className="error-message">{error.confirmPassword}</div>}
                                </div>
                                <div className="form-group text-center">
                                    <input
                                        type="submit"
                                        value="Submit"
                                        className="btn btn-primary"
                                    />
                                </div>
                                {error.general && <div className="error-message text-center">{error.general}</div>}
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
